// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

//import "@chainlink/contracts/src/v0.8/interfaces/KeeperCompatibleInterface.sol";
import "@chainlink/contracts/src/v0.8/automation/AutomationCompatible.sol";

contract CommitmentScheme is AutomationCompatibleInterface{
    bytes32 private storedSeed;
    bytes32 public commitment;
    bytes32 public revealedSeed;
    uint256 public revealDeadline;
    bool public revealed;

    event Committed(bytes32 commitment);
    event Revealed(bytes32 revealedSeed);
    event Reset();

    constructor() {
        revealed = false;
    }

    function commit(bytes32 _commitment, bytes32 _seed) public {
        require(!revealed, "Already revealed");
        commitment = _commitment;
        storedSeed = _seed;
        revealDeadline = block.timestamp + 1 minutes; // 1分後に設定
        emit Committed(_commitment);
    }

    function reveal() public {
        require(keccak256(abi.encodePacked(storedSeed)) == commitment, "Invalid seed");
        revealedSeed = storedSeed;
        revealed = true;
        emit Revealed(revealedSeed);
    }

    function checkUpkeep(bytes calldata) external view override returns (bool upkeepNeeded, bytes memory) {
        upkeepNeeded = block.timestamp >= revealDeadline && !revealed;
        return (upkeepNeeded, bytes(""));
    }

    function performUpkeep(bytes calldata) external override {
        require(block.timestamp >= revealDeadline && !revealed, "Upkeep not needed");
        reveal();
    }
     function reset() public {
        // セキュリティを考慮し、リセット機能を実行できるのは特定のアドレス（例えばオーナー）のみに限定することをお勧めします。
       //require(msg.sender == owner, "Only the owner can reset the contract");

        storedSeed = 0x0;
        commitment = 0x0;
        revealedSeed = 0x0;
        revealDeadline = 0;
        revealed = false;

        emit Reset();
    }
}
